Cancale, Châteauneuf d'Ille-et-Vilaine, Hirel, La Fresnais, La Gouesnière, La Ville-es-Nonais, Le Tronchet, Lillemer, Miniac-Morvan, Plerguer,  Saint-Benoît-des-Ondes, Saint-Coulomb, Saint-Guinoux, Saint-Jouan-des-Guérets, Saint-Malo, Saint-Méloir-des-Ondes, Saint-Père-Marc-en-Poulet et Saint-Suliac. 

**Au cœur de la Côte d’Emeraude**, à bientôt 2h15 de Paris grâce au nouveau réseau ferroviaire en cours d’aménagement, et avec des liaisons aériennes et maritimes vers la Grande Bretagne et les îles anglo-normandes,  Saint-Malo Agglomération compte déjà près de 80 000 habitants sur environ 245 km².

**Parmi ses principaux champs de compétences, Saint-Malo Agglomération gère notamment :**
-	Le développement économique ;
-	L’enseignement supérieur et la recherche ;
-	Les transports publics (réseau de transports KSMA) ;
-	L’équilibre social de l’habitat ;
-	La collecte, le traitement des déchets ;
-	La protection et la mise en valeur de l’environnement et du cadre de vie …

Le 18 décembre 2014, le Conseil Communautaire a adopté le principe d’engager la commune dans une démarche d’ouverture de ses données publiques et a adopté la Licence Ouverte pour la réutilisation de ses données.

Le département Nouvelles Technologies de l'Entente une équipe pluridisciplinaire dans le domaine des Systèmes d’Information Géographique, au service des acteurs de la gestion des risques, et plus particulièrement des incendies de forêt, en zone méditerranéenne :
- Animation les réseaux pour garantir une cohérence zonale ;
- Accompagnement et appui technique des partenaires dans leurs missions ;
- Formation aux outils géomatiques ;
- Information sur les technologies innovantes ;
- Mutualisation les outils, les techniques et les expériences.

Instaurée en 2011 par délibération du Département, la politique SIG départementale, appelée Géo17, a permis d’engager une large dynamique d’acteurs et de réaliser collectivement des projets dans de nombreux domaines.

Cette  stratégie départementale permet de :
- fédérer l’ensemble des partenaires sur des objectifs communs ;
- mutualiser et maîtriser les coûts ;
- développer l’usage des S.I.G.

Afin d'assurer la réussite de cette démarche départementale, des actions ont été définies et engagées autour de principes clefs comme :
- le partage de données, de méthodes et d'expériences permettant de rendre l'information géographique disponible pour tous ;
- la mutualisation d'achats de données, de moyens, de savoir-faire permettant à chacun de profiter des acquis collectifs ;
- la normalisation des données et des processus d'échanges conformément à la directive européenne INSPIRE.
Avec le souci permanent de diminuer les coûts.

