Le TMNlab, association loi 1901, a pour objet de constituer et animer un réseau de professionnels de la communication, de la médiation et des relations avec les publics du spectacle vivant pour :

• Favoriser, interroger et développer l'utilisation des outils numériques, existants et à venir, en communication et médiation pour les théâtres et plus largement les lieux de spectacle vivant ;

• Faciliter l'échange et la coopération entre professionnels en France et à l'étranger ;

• Donner de la visibilité, promouvoir et faire reconnaître les pratiques professionnelles innovantes.

Et ce, à travers la création d'un espace collaboratif numérique, l'organisation d'événements et tous les autres moyens et activités susceptibles de concourir à la réalisation de son objet social.

La Communauté de communes Flandre Lys (CCFL) est un Établissement Public de Coopération Intercommunale, situé dans la région des hauts de France.
Au cœur du triangle Hazebrouck (18 KM), Béthune (15 KM), Dunkerque (60 KM) et en bordure de la Métropole Européenne de Lille (30 KM), la CCFL se compose de huit communes réparties entre les départements du Nord et du Pas de Calais.


- Nord : Estaires, Haveskerque, La Gorgue et Merville ;
- Pas de Calais : Fleurbaix, Laventie, Lestrem et Sailly sur la Lys;

La Communauté de communes Flandre Lys compte 40 239 habitants.

L’AFEMAR inscrit ses actions dans le champ de l’éducation populaire par sa volonté de construire des alternatives culturelles et sociales. Elle expérimente, confronte les points de vue et tente d’innover ses outils et méthodes afin de créer une dynamique de territoire et de favoriser l’ouverture aux autres et au monde.   

L’AFEMAR favorise une éducation populaire actuelle, qui doit permettre aux citoyens de pouvoir s’organiser et agir collectivement  en ayant prise sur leur environnement et les enjeux de société. Une éducation populaire qui doit contribuer à la construction citoyenne en :
- Favorisant une éducation tout au long de la vie (aide à la prise de responsabilité, accompagnement même dans l’échec)
- Développant les lieux d’apprentissage formel et informel (groupe de réflexion, commissions,…) ;
- Favorisant l’accès à la culture, au savoir afin que les citoyens d’aujourd’hui et de demain se forgent par eux même sans prosélytisme ;
- Rendant accessible les différentes instances administratives, techniques et financières à tous les membres de l’association ; 
- Associant les adhérents à l’élaboration et la mise en œuvre de notre projet associatif.

L'école supérieure de l'éducation nationale, de l'enseignement supérieur et de la recherche (ESENESR) est un service à compétence nationale, fondé par arrêté du 24 août 2011 et rattaché à la direction générale des ressources humaines (DGRH) du ministère de l'éducation nationale et du ministère de l'enseignement supérieur, de la recherche et de l'innovation.
L'école supérieure de l'éducation nationale, de l'enseignement supérieur et de la recherche (ESENESR) est chargée de la conception, du pilotage et de la mise en œuvre de la formation des personnels d'encadrement pédagogiques et administratifs, des personnels ingénieurs, administratifs, techniques, sociaux et de santé et des personnels des bibliothèques du ministère de l'éducation nationale et du ministère de l'enseignement supérieur, de la recherche et de l'innovation, à l'exception de ceux gérés par le service de l'action administrative et de la modernisation.
Les textes suivants fixent l'organisation de l'administration centrale du ministère de l'éducation nationale, de l'enseignement supérieur et de la recherche :
- décret n° 2011-1003 du 24 août 2011 modifiant le décret n° 2006-572 ;
- arrêté du 1er juin 2015 modifiant l'arrêté du 24 août 2011 portant création de l'école supérieure de l'éducation nationale, de l'enseignement supérieur et de la recherche;
- arrêté du 9 septembre 2015 fixant la composition et les modalités de fonctionnement du conseil scientifique de l'ESENESR ;
- arrêté du 9 septembre 2015 fixant la composition et les modalités de fonctionnement du conseil d'orientation de l'ESENESR.

Fondée en 1974, la FFVL rassemble des groupements sportifs régis par la loi 1901 (les clubs) et des organismes à but lucratifs (ou OBL : les écoles), ayant pour but la pratique du vol libre dans toute la diversité de ses disciplines : delta, parapente, cerf-volant, kite, speed riding et le boomerang.

Elle a pour objet :
- d'organiser, de diriger et de promouvoir la pratique du vol libre ;
- de mettre au point un enseignement spécifique ;
- de rechercher une sécurité toujours meilleure ;
- d'étudier les règlements et programmes sportifs ;
- de soutenir, coordonner et contrôler l'action des associations ;
- de représenter le vol libre français dans le monde.

Représenté par des régions aux identités marquées, sur un territoire grand comme le Portugal ou l’Irlande, le Massif central n’en demeure pas moins un espace cohérent aux atouts et problématiques partagés. C’est pour valoriser les premiers et trouver des solutions innovantes aux secondes que les conseils régionaux d’Auvergne, de Bourgogne, du Languedoc-Roussillon, du Limousin, de Midi-Pyrénées et de Rhône-Alpes ont décidé, le 26 août 2008 de s’unir en un groupement d’intérêt public pour le développement du Massif central.
 Le GIP Massif central a ainsi été créé par arrêté interpréfectoral le 31 mars 2009 (modifié le 7 février 2014) et se donne pour mission de :
- Fédérer les actions communes au nom des 6 Régions qui le composent et promouvoir leur politique de Massif ;
- Valoriser les actions et politiques conduites par les Régions pour le développement du Massif central auprès des autorités nationales et européennes ;
- Assumer la maîtrise d’ouvrage d’études stratégiques pour le Massif central;
 - Assurer l'autorité de gestion du programme opérationnel FEDER Massif central 2014-2020

 Depuis le 1er janvier 2016, le GIP Massif central réunit les conseils régionaux d'Auvergne Rhône-Alpes, Bourgogne-Franche-Comté, Nouvelle Aquitaine et Occitanie

L'INERS, est une association de loi de 1901  , Cette  Institut Francais dédié à la recherche et à la formation sur les thématiques des questions  qui traitent du renseignement et des questions de sûreté/sécurité du contre-terrorisme et d'intelligence stratégique et des nouvelles technologies associées (CYBER-IA).
Fondée par Chems Akrouf, l’origine de la création de l’INERS relève de la volonté de satisfaire trois objectifs principaux :

contribuer à la recherche et au débat sur les questions du renseignement et des questions de sûreté/sécurité du contre-terrorisme et d'intelligence stratégique, en offrant une lecture différente et originale des enjeux associés ;
créer un centre d’expertise réellement indépendant ;
créer un lieu de dialogue et de réflexion entre tous ceux qui composent la communauté du renseignement et de sureté ,avec des experts et des spécialistes de haut niveau  venus d’horizons professionnels et philosophiques différents, qu’il s’agisse de responsables politiques, hauts fonctionnaires, industriels, militaires, experts et universitaires, etc.

Unidivers, le magazine d’information culturelle loco-national du bassin rennais et de la région Bretagne. 
Sa rédaction oeuvre en faveur de trois objectifs  :
– faire connaître aux Bretons la diversité de l’activité culturelle locale ;
– suppléer une faiblesse criante du territoire breton : l’absence de diplomatie culturelle. Il est urgent de promouvoir l’extraordinaire richesse culturelle de Rennes, de l’Ille-et-Vilaine et de la Bretagne à l’échelon national et international ;
– fruit naturel de ces deux précédents points : réveiller Rennes en dynamisant ses énergies latentes, endormies ou ignorées, afin que la capitale bretonne devienne d’ici à 2020 un haut lieu français de l’art, de la culture et du savoir. Une capitale régionale européenne innovante, créative, avant-gardiste.

Paris est la capitale qui réunit le plus grand nombre d'instituts culturels étrangers.
Ils sont 55 réunis au sein d'une association unique au monde, de l'Amérique latine en passant par la Méditerranée, l'Europe, la Russie, l'Asie, l'Extrême et le Moyen Orient.

Le FICEP, Forum des instituts culturels étrangers à Paris, a été créé en 2002 à l'initiative du Centre culturel canadien, au-delà des accords diplomatiques, avec l'objectif de mettre en valeur le rôle clef que les instituts et les centres culturels étrangers de Paris jouent dans la promotion de la diversité culturelle.

Pour la première fois, une fédération d'instituts et centres culturels ayant à coeur la défense des cultures vivantes se crée sur une base pérenne dans une grande capitale. Des acteurs culturels s'unissent et s'expriment collectivement, au-delà de la diplomatie traditionnelle et des accords-cadres bilatéraux.


Le Ficep a pour vocation...



- d'affirmer un espace de réflexion original et multilatéral sur la culture, son statut, ses conditions d'épanouissement dans le contexte de la mondialisation;



- d'exprimer collectivement une conception de la culture vivante, tolérante, ouverte, dans l'espace public français, européen et international à égale distance de la banalisation mercantile et du repli identitaire ;



- de fédérer, réunir et faire collaborer les différents instituts ou centres culturels étrangers à Paris afin de promouvoir les différentes cultures à travers la réalisation de projets d'intérêt commun ;



- de réaliser des projets d'intérêt commun mettant en relief la diversité culturelle, telle, par exemple, la semaine des cultures étrangères ;



- de représenter ses membres auprès des grandes organisations multilatérales ou association à vocation internationale ainsi qu'auprès des autorités françaises pour déterminer avec elles les actions communes et prendre toutes les dispositions nécessaires à la réalisation de ses objectifs.
